erlay_opacity=''0.4'' overlay_color=''#000000'' overlay_text_color=''#ffffff'' copyright='''' animation=''no-animation'' av_uid=''av-jma0xig2'' admin_preview_bg=''''][/av_image]\r\n[/av_two_fifth]\r\n\r\n[av_three_fifth min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-vg3x'']\r\n[av_textblock size=''18'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma0xy63'' admin_preview_bg='''']\r\n长期而稳定的澳大利亚菁英教育市场推广公司（菁英教育）合作伙伴已经遍布全国，有的是专业的澳洲留学机构，有的是英语培训机构，预科教育机构和国际高中教育机构等的全方位合作，有的是专注非澳大利亚留学服务的中介，也有的是办理澳大利亚移民的中介。长期稳定的合作，源自于合作双方透明的信息，高效的申请，高签证率和佣金分享比例的合理以及佣金发放的及时。\r\n\r\n如果您是留学中介，移民中介，英语教育机构，国际学校, 预科学院或有澳大利亚留学生资源的任何机构（个人），我们诚挚地欢迎您成为菁英教育澳大利亚留学项目的合作伙伴！我们期待与您携手合作，分享澳大利亚优质教育资源，将莘莘学子送往澳大利亚深造，以圆众多学子与家长的梦想！\r\n[/av_textblock]\r\n[/av_three_fifth]\r\n\r\n[av_layout_row border='''' min_height_percent='''' min_height=''0'' color=''main_color'' mobile=''av-flex-cells'' id=''full_width_content'' av_element_hidden_in_editor=''0'' mobile_breaking='''' av_uid=''av-1d0u9'']\r\n\r\n[av_cell_one_full vertical_align=''top'' padding=''0px'' padding_sync=''true'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src=''http://localhost/eemcn/wp-content/uploads/2018/09/coorperation_02.png'' attachment=''129'' attachment_size=''full'' background_attachment=''scroll'' background_position=''top left'' background_repeat=''no-repeat'' link='''' linktarget='''' link_hover='''' mobile_display='''' av_uid=''av-jmfqt4yg'']\r\n\r\n[av_one_full first min_height='''' vertical_alignment=''av-align-top'' space='''' margin=''0px'' margin_sync=''true'' link='''' linktarget='''' link_hover='''' padding=''30px,0px,50px,0px'' border='''' border_color='''' radius=''0px'' radius_sync=''true'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' attachment='''' attachment_size='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-xxh5'']\r\n\r\n[av_textblock size=''30'' font_color=''custom'' color=''#ffffff'' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jmfrrggb'' admin_preview_bg='''']\r\n<p id="cooperation__sub-menu"><span style="color: #1174d7;">为合作伙伴提供的服务</span>                       <a href="http://localhost/eemcn/australia-university-list/" target="_blank" rel="noopener" data-wplink-url-error="true">澳大利亚院校名单</a></p>\r\n[/av_textblock]\r\n\r\n[av_hr class=''invisible'' height=''30'' shadow=''no-shadow'' position=''center'' custom_border=''av-border-thin'' custom_width=''50px'' custom_border_color='''' custom_margin_top=''30px'' custom_margin_bottom=''30px'' icon_select=''yes'' custom_icon_color='''' icon=''ue808'' font=''entypo-fontello'' av_uid=''av-jmfrep4h'' admin_preview_bg='''']\r\n\r\n[av_iconlist position=''left'' iconlist_styling=''av-iconlist-small'' custom_title_size=''28'' custom_content_size='''' font_color=''custom'' custom_title=''#bebaba'' custom_content='''' color=''custom'' custom_bg='''' custom_font=''#747422'' custom_border='''' av-medium-font-size-title='''' av-small-font-size-title='''' av-mini-font-size-title='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jmfr7bu4'' admin_preview_bg='''']\r\n[av_iconlist_item title=''菁英教育为您提供相关留学方案咨询；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-27avx''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您免费申请澳大利亚院校的入学；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-1mjth''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您递交学生签证和监护人签证申请；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-12k2d''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您安排到澳后续服务，如接机安排、住宿安排服务等；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-236cp''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您分享高比例的佣金；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-1e7nx''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您定期提供澳大利亚留学最新政策变化和合作院校最新资讯。'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-13twd''][/av_iconlist_item]\r\n[/av_iconlist]\r\n\r\n[av_hr class=''invisible'' height=''30'' shadow=''no-shadow'' position=''center'' custom_border=''av-border-thin'' custom_width=''50px'' custom_border_color='''' custom_margin_top=''30px'' custom_margin_bottom=''30px'' icon_select=''yes'' custom_icon_color='''' icon=''ue808'' font=''entypo-fontello'' av_uid=''av-jmfrep4h'' admin_preview_bg='''']\r\n\r\n[av_textblock size='''' font_color=''custom'' color=''#ffffff'' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jmfqxu3u'' admin_preview_bg='''']\r\n<span style="font-size: 41px;">请联系张老师讨论渠道合作事宜</span>\r\n\r\n<span style="font-size: 36px;"> services @eemc.com.cn</span>\r\n[/av_textblock]\r\n\r\n[/av_one_full][/av_cell_one_full][/av_layout_row]'),
