right='''' animation=''no-animation'' av_uid=''av-jma0xig2'' admin_preview_bg=''''][/av_image]\r\n\r\n[/av_two_fifth][av_three_fifth min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-vg3x'']\r\n\r\n[av_textblock size=''18'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma0xy63'' admin_preview_bg='''']\r\n长期而稳定的澳大利亚菁英教育市场推广公司（菁英教育）合作伙伴已经遍布全国，有的是专业的澳洲留学机构，有的是英语培训机构，预科教育机构和国际高中教育机构等的全方位合作，有的是专注非澳大利亚留学服务的中介，也有的是办理澳大利亚移民的中介。长期稳定的合作，源自于合作双方透明的信息，高效的申请，高签证率和佣金分享比例的合理以及佣金发放的及时。\r\n\r\n如果您是留学中介，移民中介，英语教育机构，国际学校, 预科学院或有澳大利亚留学生资源的任何机构（个人），我们诚挚地欢迎您成为菁英教育澳大利亚留学项目的合作伙伴！我们期待与您携手合作，分享澳大利亚优质教育资源，将莘莘学子送往澳大利亚深造，以圆众多学子与家长的梦想！\r\n[/av_textblock]\r\n\r\n[/av_three_fifth]'),
