(518, 143, '_aviaLayoutBuilderCleanData', '[av_layout_row border='''' min_height_percent='''' min_height=''0'' color=''main_color'' mobile=''av-flex-cells'' id='''' av_element_hidden_in_editor=''0'' mobile_breaking='''' av_uid=''av-jm8rtw50'']\r\n[av_cell_one_full vertical_align=''top'' padding=''0px'' padding_sync=''true'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' attachment='''' attachment_size='''' background_attachment=''fixed'' background_position=''center center'' background_repeat=''no-repeat'' link='''' linktarget='''' link_hover='''' mobile_display='''' av_uid=''av-jm8rsnrs'']\r\n\r\n[av_textblock size='''' font_color=''custom'' color=''#ffffff'' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jm8rtljb'' admin_preview_bg='''']\r\n<div id="page-title" class="cooperation__title--bg">\r\n<h1 style="text-align: center;">COOPERATION</h1>\r\n<h3 style="text-align: center;"><span class="page-title__mark-line"> </span>留学中介渠道合作<span class="page-title__mark-line"> </span></h3>\r\n</div>\r\n[/av_textblock]\r\n\r\n[/av_cell_one_full]\r\n[/av_layout_row]\r\n\r\n[av_two_fifth first min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-1s2kh'']\r\n[av_image src=''http://localhost/eemcn/wp-content/uploads/2018/09/2ea8b4d7e4debc00ac321815130f1e45.png'' attachment=''59'' attachment_size=''full'' align=''center'' styling='''' hover='''' link='''' target='''' caption='''' font_size='''' appearance='''' overlay_opacity=''0.4'' overlay_color=''#000000'' overlay_text_color=''#ffffff'' copyright='''' animation=''no-animation'' av_uid=''av-jma0xig2'' admin_preview_bg=''''][/av_image]\r\n[/av_two_fifth]\r\n\r\n[av_three_fifth min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-vg3x'']\r\n[av_textblock size=''18'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma0xy63'' admin_preview_bg='''']\r\n长期而稳定的澳大利亚菁英教育市场推广公司（菁英教育）合作伙伴已经遍布全国，有的是专业的澳洲留学机构，有的是英语培训机构，预科教育机构和国际高中教育机构等的全方位合作，有的是专注非澳大利亚留学服务的中介，也有的是办理澳大利亚移民的中介。长期稳定的合作，源自于合作双方透明的信息，高效的申请，高签证率和佣金分享比例的合理以及佣金发放的及时。\r\n\r\n如果您是留学中介，移民中介，英语教育机构，国际学校, 预科学院或有澳大利亚留学生资源的任何机构（个人），我们诚挚地欢迎您成为菁英教育澳大利亚留学项目的合作伙伴！我们期待与您携手合作，分享澳大利亚优质教育资源，将莘莘学子送往澳大利亚深造，以圆众多学子与家长的梦想！\r\n[/av_textblock]\r\n[/av_three_fifth]\r\n\r\n[av_layout_row border='''' min_height_percent='''' min_height=''0'' color=''main_color'' mobile=''av-flex-cells'' id=''full_width_content'' av_element_hidden_in_editor=''0'' mobile_breaking='''' av_uid=''av-1d0u9'']\r\n\r\n[av_cell_one_full vertical_align=''top'' padding=''0px'' padding_sync=''true'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src=''http://localhost/eemcn/wp-content/uploads/2018/09/coorperation_02.png'' attachment=''129'' attachment_size=''full'' background_attachment=''scroll'' background_position=''top left'' background_repeat=''no-repeat'' link='''' linktarget='''' link_hover='''' mobile_display='''' av_uid=''av-jmfqt4