llo'' av_uid=''av-27avx''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您免费申请澳大利亚院校的入学；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-1mjth''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您递交学生签证和监护人签证申请；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-12k2d''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您安排到澳后续服务，如接机安排、住宿安排服务等；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-236cp''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您分享高比例的佣金；'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-1e7nx''][/av_iconlist_item]\r\n[av_iconlist_item title=''菁英教育为您定期提供澳大利亚留学最新政策变化和合作院校最新资讯。'' link='''' linktarget='''' linkelement='''' icon=''ue89a'' font=''entypo-fontello'' av_uid=''av-13twd''][/av_iconlist_item]\r\n[/av_iconlist]\r\n\r\n[av_hr class=''invisible'' height=''30'' shadow=''no-shadow'' position=''center'' custom_border=''av-border-thin'' custom_width=''50px'' custom_border_color='''' custom_margin_top=''30px'' custom_margin_bottom=''30px'' icon_select=''yes'' custom_icon_color='''' icon=''ue808'' font=''entypo-fontello'' av_uid=''av-jmfrep4h'' admin_preview_bg='''']\r\n\r\n[av_textblock size='''' font_color=''custom'' color=''#ffffff'' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jmfqxu3u'' admin_preview_bg='''']\r\n<span style="font-size: 41px;">请联系张老师讨论渠道合作事宜</span>\r\n\r\n<span style="font-size: 36px;"> services @eemc.com.cn</span>\r\n[/av_textblock]\r\n\r\n[/av_one_full][/av_cell_one_full][/av_layout_row]', '留学中介渠道合作', '', 'publish', 'closed', 'closed', '', 'oversea-study-education-agency-cooperation-channel', '', '', '2018-09-25 09:23:11', '2018-09-25 01:23:11', '', 0, 'http://localhost/eemcn/?page_id=33', 0, 'page', '', 0),
