(41, 1, '2018-09-20 12:51:33', '2018-09-20 04:51:33', '[av_layout_row border='''' min_height_percent='''' min_height=''0'' color=''main_color'' mobile=''av-flex-cells'' id='''' av_element_hidden_in_editor=''0'' mobile_breaking='''' av_uid=''av-jm8rtw50'']\n[av_cell_one_full vertical_align=''top'' padding=''0px'' padding_sync=''true'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' attachment='''' attachment_size='''' background_attachment=''fixed'' background_position=''center center'' background_repeat=''no-repeat'' link='''' linktarget='''' link_hover='''' mobile_display='''' av_uid=''av-jm8rsnrs'']\n\n[av_textblock size='''' font_color=''custom'' color=''#ffffff'' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jm8rtljb'' admin_preview_bg='''']\n<div id="page-title">\n<h1 style="text-align: center;">About Us</h1>\n<h3 style="text-align: center;"><span class="page-title__mark-line"></span>关于我们<span class="page-title__mark-line"></span></h3>\n</div>\n[/av_textblock]\n\n[/av_cell_one_full]\n[/av_layout_row]\n\n[av_two_fifth first min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-1s2kh'']\n[av_image src=''http://localhost/eemcn/wp-content/uploads/2018/09/education-png-0.png'' attachment=''44'' attachment_size=''full'' align=''center'' styling='''' hover='''' link='''' target='''' caption='''' font_size='''' appearance='''' overlay_opacity=''0.4'' overlay_color=''#000000'' overlay_text_color=''#ffffff'' copyright='''' animation=''no-animation'' av_uid=''av-jma0xig2'' admin_preview_bg=''''][/av_image]\n[/av_two_fifth]\n\n[av_three_fifth min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-vg3x'']\n[av_textblock size=''18'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma0xy63'' admin_preview_bg='''']\n澳大利亚菁英教育市场推广公司（以下简称菁英教育），起源于澳大利亚，专注于澳大利亚留学服务。我们的咨询顾问团队，大部分具有澳大利亚或其他海外国家的留学经历，以及多年留学行业工作经验，熟悉澳大利亚教育体系和院校信息。我们的签证团队包含了澳大利亚注册移民代理，及时获取移民政策或法律的变化。我们的学生签证成功率，每年均达99%以上！\n[/av_textblock]\n[/av_three_fifth]\n\n[av_layout_row border='''' min_height_percent='''' min_height=''0'' color=''main_color'' mobile=''av-flex-cells'' id=''full_width_content'' av_element_hidden_in_editor=''0'' mobile_breaking='''' av_uid=''av-2mcx9'']\n\n[av_cell_one_full vertical_align=''top'' padding=''0px'' padding_sync=''true'' background=''bg_color'' background_color=''#b5b5b5'' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' attachment='''' attachment_size='''' background_attachment=''scroll'' background_position=''top left'' background_repeat=''no-repeat'' link='''' linktarget='''' link_hover='''' mobile_display='''' av_uid=''av-jma12fa3'']\n\n[av_one_third first min_height=''av-equal-height-column'' vertical_alignment=''av-align-top'' space='''' custom_margin=''aviaTBcustom_margin'' margin=''100px'' margin_sync=''true'' link='''' linktarget='''' link_hover='''' padding=''60px'' padding_sync=''true'' border='''' border_color='''' radius=''0px'' radius_sync=''true'' background=''bg_color'' background_color=''#ffffff'' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' attachment='''' attachment_size='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-21krx'']\n\n[av_textblock size=''24'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma1ngn3'' admin_preview_bg='''']\n<h3 style="text-align: center;"><span class="sub-title">院校资源</span></h3>\n[/av_textblock]\n\n[av_textblock size=''16'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma15b5q'' admin_preview_bg='''']\n菁英教育立足于澳大利亚，常年积极开拓和维护广泛的澳大利亚本土教育资源，并与各教育机构建立起良好的合作关系。常年稳定的、优质的留学生生源，获得了我们合作院校的好评。\n[/av_textblock]\n\n[/av_one_third][av_one_third min_height='''' vertical_alignment=''av-align-top'' space='''' margin=''0px'' margin_sync=''true'' link='''' linktarget='''' link_hover='''' padding=''60px'' padding_sync=''true'' border='''' border_color='''' radius=''0px'' radius_sync=''true'' background=''bg_color'' background_color=''#ffffff'' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' attachment='''' attachment_size='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-1kii1'']\n\n[av_textblock size=''24'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma1ngn3'' admin_preview_bg='''']\n<h3 style="text-align: center;"><span class="sub-title">澳大利亚办公室</span></h3>\n[/av_textblock]\n\n[av_textblock size=''16'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma15lwk'' admin_preview_bg='''']\n菁英教育在澳大利亚的悉尼、墨尔本和霍巴特均设有办公室，已经有二十年左右的历史，常年维护与各教育机构的良好合作关系，第一时间获取学校信息，保障学生申请的平稳顺利进行，并为学生提供一系列的优质后续服务。\n[/av_textblock]\n\n[/av_one_third][av_one_third min_height='''' vertical_alignment=''av-align-top'' space='''' margin=''0px'' margin_sync=''true'' link='''' linktarget='''' link_hover='''' padding=''60px'' padding_sync=''true'' border='''' border_color='''' radius=''0px'' radius_sync=''true'' background=''bg_color'' background_color=''#ffffff'' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' attachment='''' attachment_size='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid=''av-14g6l'']\n\n[av_textblock size=''24'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma1ngn3'' admin_preview_bg='''']\n<h3 style="text-align: center;"><span class="sub-title">后续服务</span></h3>\n[/av_textblock]\n\n[av_textblock size=''16'' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma15wyv'' admin_preview_bg='''']\n我们可为您的学生提供后续的服务和帮助，如接机安排、住宿安排、升学转学、换签续签、申请职业年课程、申请工作签证、申请移民等，为您的学生提供澳大利亚留学移民一站式专业服务。\n[/av_textblock]\n\n[/av_one_third][/av_cell_one_full][/av_layout_row]', '关于我们', '', 'inherit', 'closed', 'closed', '', '13-autosave-v1', '', '', '2018-09-20 12:51:33', '2018-09-20 04:51:33', '', 13, 'http://localhost/eemcn/2018/09/20/13-autosave-v1/', 0, 'revision', '', 0),
