1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid='''']\r\n\r\n[av_textblock size='''' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma15b5q'' admin_preview_bg='''']\r\n菁英教育立足于澳大利亚，常年积极开拓和维护广泛的澳大利亚本土教育资源，并与各教育机构建立起良好的合作关系。常年稳定的、优质的留学生生源，获得了我们合作院校的好评。\r\n[/av_textblock]\r\n\r\n[/av_one_third][av_one_third min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid='''']\r\n\r\n[av_textblock size='''' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma15lwk'' admin_preview_bg='''']\r\n菁英教育在澳大利亚的悉尼、墨尔本和霍巴特均设有办公室，已经有二十年左右的历史，常年维护与各教育机构的良好合作关系，第一时间获取学校信息，保障学生申请的平稳顺利进行，并为学生提供一系列的优质后续服务。\r\n[/av_textblock]\r\n\r\n[/av_one_third][av_one_third min_height='''' vertical_alignment='''' space='''' custom_margin='''' margin=''0px'' link='''' linktarget='''' link_hover='''' padding=''0px'' border='''' border_color='''' radius=''0px'' background=''bg_color'' background_color='''' background_gradient_color1='''' background_gradient_color2='''' background_gradient_direction=''vertical'' src='''' background_position=''top left'' background_repeat=''no-repeat'' animation='''' mobile_breaking='''' mobile_display='''' av_uid='''']\r\n\r\n[av_textblock size='''' font_color='''' color='''' av-medium-font-size='''' av-small-font-size='''' av-mini-font-size='''' av_uid=''av-jma15wyv'' admin_preview_bg='''']\r\n我们可为您的学生提供后续的服务和帮助，如接机安排、住宿安排、升学转学、换签续签、申请职业年课程、申请工作签证、申请移民等，为您的学生提供澳大利亚留学移民一站式专业服务。\r\n[/av_textblock]\r\n\r\n[/av_one_third][/av_cell_one_full][/av_layout_row]', '关于我们', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2018-09-20 11:43:48', '2018-09-20 03:43:48', '', 13, 'http://localhost/eemcn/2018/09/20/13-revision-v1/', 0, 'revision', '', 0),
